import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';

const Main = () => {
    return (
        <Container fluid>
            <Row>
                <Col md={4} className="full-length-col">
                    <div className="sidemenu">
                        Sidebar
                    </div>
                </Col>
                <Col className="bg-light full-length-col">
                    Diary
                </Col>
            </Row>
        </Container>
    )
}

export default Main;
